import React from 'react';
import logoMesto from '../images/header_logo.svg';

function Header() {
  return (
    <header className="header">
      <a className="header__logo" href="#"><img className="header__logo-image" src={logoMesto}
        alt="Лого Место" /></a>
    </header>)
}

export default Header;
